function ModalDelete({isOpen, setOpen}, props) {
  if(isOpen) {
    return(
      <div className="fundoModal">
      <div className="container">
        <h1>Deseja excluir o produto: {props.id} - {nome}</h1>
        <button onClick={setOpen(!isOpen)}>Cancelar</button>
      </div>
    </div>
    )
  }
}

export default ModalDelete
